  let { id } = useParams();
  const [data, setData] = useState([]);

  useEffect(async () => {
    axios.get(`http://localhost:5000/kategorije/provjere/${id}`).then((res) => {
      console.log(res.data);
      setData(res.data);
      // const provjera = data.filter((p) => {
      //   return p.provjere._id.includes(id);
      // });
      // console.log("provjera: ", provjera);
    });
    console.log(data[0]).catch((err) => {
      console.log(err);
    });
  }, []);

  return (
    <div>
      <h1>Provjera</h1>
    </div>
  );
};

export default Provjera;
